import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Strategy() {
  return (
    <Container
      fluid
      className="my-5 py-5"
      style={{
        paddingLeft: "7rem",
        paddingRight: "7rem",
        fontFamily: "secondary-font",
        backgroundColor: "#F9E95D",
      }}
    >
      <div style={{ textAlign: "center" }}>
        <h1 style={{ fontFamily: "primary-font", fontSize: 55 }}>
          Our strategy
        </h1>
      </div>

      <Row
        className="g-1 my-5 pt-4"
        style={{
          display: "flex",
          justifyContent: "center",
          marginLeft: "10rem",
        }}
      >
        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
          <p>Text</p>
        </Col>

        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
          <p>Text</p>
        </Col>

        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
          <p>Text</p>
        </Col>

        <Col md={3}>
          <div
            style={{
              width: 50,
              height: 50,
              borderRadius: "50%",
              backgroundColor: "#2D2828",
            }}
          ></div>
          <p>Text</p>
        </Col>
      </Row>

      <div style={{ border: "1px solid black", width: 1580 }}></div>
    </Container>
  );
}

export default Strategy;
